// src/components/Header.js
import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="Header">
      <h1>Uma Bisht</h1>
      <p>New Delhi, India 110018</p>
      <p>+91 6395835710</p>
      <p><a href="mailto:umabisht686@gmail.com">umabisht686@gmail.com</a></p>
      <p><a href="https://github.com/umabisht1324" target="_blank" rel="noopener noreferrer">GitHub</a></p>
    </header>
  );
}

export default Header;
